import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGlobe, faBars } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  const [isNavbar1Visible, setNavbar1Visible] = useState(false);
  const [isNavbar2Visible, setNavbar2Visible] = useState(false);

  const toggleNavbar1 = () => {
    setNavbar1Visible(!isNavbar1Visible);
    setNavbar2Visible(false); // Hide navbar2 when navbar1 is shown
  };

  const toggleNavbar2 = () => {
    setNavbar2Visible(!isNavbar2Visible);
    setNavbar1Visible(false); // Hide navbar1 when navbar2 is shown
  };

  return (
    <div className="navbar">
      <div className="navbar-header">
        <div className="navbar-hamburger" onClick={toggleNavbar1}>
          <FontAwesomeIcon icon={faBars} />
        </div>
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
      </div>
      <div className={`navbar1 navbar-menu ${isNavbar1Visible ? 'show' : ''}`}>
        <ul>
          <li>Driver</li>
          <li>Rider</li>
          <li>Business</li>
          <li>Log in</li>
          <li>Sign up</li>
          <li><FontAwesomeIcon icon={faGlobe} /> En</li>
        </ul>
      </div>
      <div className={`navbar2 navbar-menu2 ${isNavbar2Visible ? 'show' : ''}`}>
        <ul>
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
